import React from 'react';
import { func } from 'prop-types';
import styled, {css} from 'styled-components';
import { v4 as uuidv4 } from 'uuid';
import { Typography, Button } from '../../atoms';
import {routes, links, text} from '../../../utils';

const StyledButton = styled(Button)`
  ${() => css`
    width: fit-content;
  `}
`;

const items = [
  {
    link: links.email,
    content: text.menuModule.sideLinks.email
  },
  {
    link: links.linkedIn,
    content: text.menuModule.sideLinks.linkedIn
  },
  {
    link: links.facebook,
    content: text.menuModule.sideLinks.facebook
  },
  {
    link: links.instagram,
    content: text.menuModule.sideLinks.instagram
  }
];

const SideLinks = () => {
  return (
    <>
      { items.map(item => 
          <Typography 
            key={uuidv4()} 
            as="a" 
            href={item.link} 
            color='white' 
            size='xs' 
            marginBottom='xl4' 
            family='sauceOne'
          >
            {item.content}
          </Typography>
      )}
    </>
  )
};

const MainLinks = ({handleRedirectToPage}) => {
  return (
    <>
      <StyledButton onClick={handleRedirectToPage(routes.projects)}>
        <Typography 
          transform='uppercase' 
          size='xl3' 
          color='white' 
          family='sauceSans'
        >
          {text.menuModule.mainLinks.projects}
        </Typography>
      </StyledButton>
      <StyledButton onClick={handleRedirectToPage(routes.team)}>
        <Typography 
          transform='uppercase' 
          size='xl3' 
          color='white' 
          family='sauceSans'
        >
          {text.menuModule.mainLinks.team}
        </Typography>
      </StyledButton>
      <StyledButton>
        <Typography 
          as="a" 
          href={links.blog} 
          transform='uppercase' 
          size='xl3' 
          decoration='none' 
          color='white' 
          family='sauceSans'
        >
          {text.menuModule.mainLinks.blog}
        </Typography>
      </StyledButton>
      <StyledButton onClick={handleRedirectToPage(routes.sayHi)}>
        <Typography 
          transform='uppercase' 
          size='xl3' 
          color='white' 
          family='sauceSans'
        >
          {text.menuModule.mainLinks.sayHi}
        </Typography>
      </StyledButton>
    </>
  )
};

MainLinks.propTypes = {
  handleRedirectToPage: func,
};

const Links = {
  SideLinks,
  MainLinks,
};

export default Links;
